script: |
  super -f text -I q11724.spq | sort > q11724.out

inputs:
  - name: q11724.spq
    data: |
      SELECT DISTINCT col0 * - ( 90 ) + - col1 + - - col0 * - - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - - col2 * + + 67 / + 6 + + - 62 + - + col0 >= 23;
  - name: tab0

outputs:
  - name: q11724.out
    data: |
      -6024
